INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (167,'011','동풍이 서서히 풀리고 마른나무가 봄을 만났으니 이제야 좋은 운이 돌아왔습니다. 재물이 왕성하고 경영하는 일은 늦게라도 성공되겠습니다. 작게 가고 크게 오니 비록 작게 시작해도 크게 성공되겠으며 모든 재앙이 사라지고 복이 찾아오니 마음이 편안하겠습니다. 명월이 중천하니 천지가 밝고 분명하여 어두운 구석이 없고 세상만사가 두루두루 편안하겠습니다. 큰 일을 꾸하고자 하는데 어찌 작은 일심과 염려로 주저하겠습니까? 멀리에서 귀인을 만나면 몸은 영화롭고 집은 편안해지겠습니다. 한번 큰 변화를 일으켜서 새 일을 도모하려는 뜻이 있겠으니 때로는 의심과 염려가 있을 것이나 주저하지 않고 진행시키면 반드시 보람이 따르겠으며 봄에는 다소 지체되는 감도 있지만 7,8월경에는 성공되겠습니다. 좋은 인연을 만나면 더욱 쉽게 풀려 나가겠습니다.','봄날이 따뜻해지니 부질이 가까운 누각으로 날아들어 보금자리를 앉고 새끼를 치는 격이니 모든 재앙이 사라지고 복덕이 돌아올 수라 반드시 경사가 있겠습니다.','봄동산에 복숭아꽃과 오얏꽃이 때를 만나 서로 만발하여 봄기운을 띄우니 신수가 대길해져 재물이 스스로 들어오겠습니다. 그러나 친구나 친척 또한 가족의 일로 마음이 상하는 일도 있겠습니다.','높은산에 들어가 마음을 가다듬고 소원을 빌거나 절에 가서 기도를 들이면 반드시 안정을 얻게 되겠습니다. 바라 높은 일이 왠일인가 따르고 경영하는 바가 순조롭지 않더라도 항상 기도하는 마음을 놓지 마십시오. 마음을 하나로 정하지 못하고 흔들림이 많으니 곧히 동불서주하고 바쁘기만 하겠습니다.','일이 성공되기 전에 구설수가 따르기 쉬우니 조심하시기 바라며 업행을 신경을 쓴다면 여수가 역리기 때문에 모든 일들이 순조롭게 이루어지겠습니다. 이미 험준한 산길을 지나왔서 큰길에 들어섰는데 무슨 걱정이 있겠습니까? 앞날은 대로를 걷게 되겠습니다.','입을 조심하십시오. 아무리 옳은 말이라도 한번 실수하면 시비에 말려들게 됩니다. 입을 봉하고 본 것도 보지 않은 듯 들은 것도 듣지 않은 것처럼 지내십시오. 타향 객지에서 친구를 만났다 하더라도 말을 조심하고 객지에서 친구를 사귀더라도 신중을 기해야합니다.','이성을 가까이 하면 구설수가 생기기 쉽습니다. 정해진 궤도를 횡소처럼 걸어가야지 한눈을 팔면 구설수에 오르게됩니다. 사람을 사귀려하지 말고 멀리 출행하여 새 것을 도모하지 마십시오. 편안하게 분수를 지키는 것만이 제일 좋은 방법입니다.','봄동산에 피었던 꽃들이 드디어 때를 만나 열매를 맺는 것과 같은 운으로서 만약 관례을 받아 출세의 길이 열리지 않는다면 자손이나 가족에게 경사가 생기겠습니다. 그러나 잠병이 도사리고 있으니 건강관리에 신경을 쓰기 바라며 매사를 서두르지 말고 차분하게 기다리고 지혜롭게 대처하시기 바랍니다.','형산이 있는 듯 하면서도 그 실상은 보이거나 잡히지 않으니 반드시 흉험함을 느낄게 될 것입니다. 그러나 착고 기다렸다면 재물이 스스로 들어올 것이니 경고망동을 하지 않도록 하십시오. 처음은 어렵게 막히는 듯하지만 그것이 풀려 나중에는 반드시 좋게되고 어려운 때는 귀인의 도움 있겠으니 기대하시기 바랍니다.','세월의 흐름에 따라 재물이 스스로 물러나기 시작하니 성사를 하거나 남의 시비에 낮아들지 마십시오. 손재수가 있겠습니다. 손재수는 반드시 사람을 잘못 사귐으로 인한 것이니 친한 사람일수록 경계하게 대하지 말고 인간을 존중해 준다면 흉을 면하겠습니다.','염부솜이 날아갔는지 분주하기만 합니다. 할 일은 많은데 신수가 불리하니 잠병을 조심하십시오 너무 분주한 틈에 건강을 해치기 쉽습니다.','의수가 불리하고 마음도 편치 않으니 동북 지방에는 출행하지 않는 것이 좋겠습니다. 집안에 있으면서 하던 일을 지켜나가면 이롭겠지만 분수를 지키지 않고 엉뚱한 것을 탐하여 손을 벌치면 불리하겠습니다. 마음이 편안하면 분수를 지키고 출행을 금하여 집안에서 하던 일을 지키는 것이 좋습니다.','새 일을 버리지 마십시오. 험되이 마음만 쓰고 지치게 됩니다. 몸은 왕성하고 뜻은 크지만 재물이 없으니 길함과 흉함이 반반 이겠습니다. 많이 보내고 적게 들어오니 도리어 손도 헛 것 같지 않겠습니다. 마음과 재물이 동시에 있어야만 경영을 하는 법이니 조급하게 서두지 마시기 바랍니다.','2025-03-02 03:02:00.953234+00','k');
